window.bookSummaryJSON = "<p><i>Debt of Honor</i> ends as Jack Ryan is confirmed vice president minutes before a mammoth act of terrorism kills the President, most of his cabinet, all but a few members of Congress, the entire Supreme Court and all of the Joint Chiefs of Staff. Suddenly Ryan is President, which is where <i>Executive Orders</i> begins.</p> <p>Ryan's responsibilities crush in on him. Where should he begin? He must calm a nation, pacify world leaders, arrange a massive funeral -- while he rebuilds a government as quickly as possible. But that's not all. Enemies abroad and at home see opportunities, and they'll soon present President Ryan with an unimaginable crisis. How will he tackle his greatest challenge ever?</p>"; 
